import React from 'react';
import './Project.css';
import Projectimg from './Projectimg';


function Project() {
  return (
    <div className='projects'>
        <div className="project-title">
            <h1>Projects</h1>
        </div>
        <div className="project-all" >
            {Projectimg.map((h,id)=>(
                <img key={h.id} src={h.proimg} alt=''/>
                ))}
        </div>
    </div>
  )
}
const proimg=[
    {
        id:1,
        Name:'Netflix Landing Page',
        img:projectimages
    },
    {
        id:2,
        Name:'Netflix Landing Page',
        img:projectimages
    },
    {
        id:3,
        Name:'Netflix Landing Page',
        img:projectimages
    },
    {
        id:4,
        Name:'Netflix Landing Page',
        img:projectimages
    },
]

export default Project
